        // [Test]
        public void GetLang()
        {
            var obj = ToObject(Resources.Pages.De.Index.ResourceManager);
        }


        private static ExpandoObject ToObject(ResourceManager rm)
        {
            IDictionary<string, object> eObj = new ExpandoObject();
            var dict = rm.GetResourceSet(CultureInfo.CurrentUICulture, true, true).Cast<DictionaryEntry>().ToDictionary(r => r.Key.ToString(), r => r.Value.ToString());
            foreach (var dic in dict)
            {
                eObj[dic.Key] = dic.Value;
            }
            dynamic deObj = eObj;
            return deObj;
        }
